import React, { useState, useEffect } from "react";
import axios from "axios";

const Booking = () => {
  const [paymentDetails, setPaymentDetails] = useState({});
  const [isDataAvailable, setIsDataAvailable] = useState(true);
  const [loading, setLoading] = useState(true);
  const [newPaymentStatus, setNewPaymentStatus] = useState("");
  const [statusUpdateError, setStatusUpdateError] = useState("");

  useEffect(() => {
    const fetchPaymentData = async () => {
      try {
        const response = await axios.get(
          "http://localhost:8000/medical_store_app/payment_details/"
        );
        if (response.data.paymentDetails && response.data.paymentDetails.length > 0) {
          setPaymentDetails(response.data.paymentDetails[0]);
          setNewPaymentStatus(response.data.paymentDetails[0].payment_status || "pending");
          setIsDataAvailable(true);
        } else {
          setIsDataAvailable(false);
        }
      } catch (error) {
        setIsDataAvailable(false);
      } finally {
        setLoading(false);
      }
    };

    fetchPaymentData();
  }, []);

  const handlePaymentStatusChange = async () => {
    try {
      const updatedData = { payment_status: newPaymentStatus };
      const response = await axios.put(
        `http://localhost:8000/medical_store_app/payment_details/${paymentDetails.id}/`,
        updatedData
      );
      setPaymentDetails((prevDetails) => ({
        ...prevDetails,
        payment_status: newPaymentStatus,
      }));
      setStatusUpdateError("");
    } catch (error) {
      setStatusUpdateError("Failed to update payment status. Please try again.");
    }
  };

  return (
    <div style={styles.containerStyle}>
      <h1 style={styles.titleStyle}>Booking Details</h1>
      {loading ? (
        <p>Loading...</p>
      ) : !isDataAvailable ? (
        <p style={styles.errorStyle}>No booking details available.</p>
      ) : (
        <>
          <table style={styles.tableStyle}>
            <thead>
              <tr>
                <th style={styles.headerStyle}>Field</th>
                <th style={styles.headerStyle}>Value</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td style={styles.cellStyle}>Payment ID</td>
                <td style={styles.cellStyle}>{paymentDetails.razorpay_payment_id || "N/A"}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Order ID</td>
                <td style={styles.cellStyle}>{paymentDetails.razorpay_order_id || "N/A"}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Amount</td>
                <td style={styles.cellStyle}>{paymentDetails.amount || "N/A"}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Signature</td>
                <td style={styles.cellStyle}>{paymentDetails.razorpay_signature || "N/A"}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Created At</td>
                <td style={styles.cellStyle}>{paymentDetails.created_at || "N/A"}</td>
              </tr>
              <tr>
                <td style={styles.cellStyle}>Payment Status</td>
                <td style={styles.cellStyle}>
                  {paymentDetails.payment_status || "pending"}
                </td>
              </tr>
            </tbody>
          </table>

          <div style={styles.updateSection}>
            <h3>Update Payment Status</h3>
            <select
              value={newPaymentStatus}
              onChange={(e) => setNewPaymentStatus(e.target.value)}
              style={styles.selectStyle}
            >
              <option value="pending">Pending</option>
              <option value="completed">Completed</option>
              <option value="failed">Failed</option>
            </select>
            <button onClick={handlePaymentStatusChange} style={styles.buttonStyle}>
              Update Status
            </button>
            {statusUpdateError && (
              <p style={styles.errorStyle}>{statusUpdateError}</p>
            )}
          </div>
        </>
      )}
    </div>
  );
};

const styles = {
  containerStyle: {
    margin: "50px auto",
    padding: "20px",
    maxWidth: "800px",
    border: "1px solid #ddd",
    borderRadius: "8px",
    backgroundColor: "#f9f9f9",
  },
  titleStyle: {
    textAlign: "center",
    marginBottom: "20px",
  },
  tableStyle: {
    width: "100%",
    borderCollapse: "collapse",
  },
  headerStyle: {
    borderBottom: "2px solid #000",
    padding: "10px",
    textAlign: "left",
    fontWeight: "bold",
  },
  cellStyle: {
    padding: "10px",
    borderBottom: "1px solid #ddd",
  },
  errorStyle: {
    textAlign: "center",
    color: "red",
    fontSize: "18px",
  },
  updateSection: {
    marginTop: "20px",
    padding: "20px",
    backgroundColor: "#f0f0f0",
    borderRadius: "8px",
  },
  selectStyle: {
    padding: "10px",
    marginRight: "10px",
  },
  buttonStyle: {
    padding: "10px 20px",
    backgroundColor: "#4CAF50",
    color: "#fff",
    border: "none",
    cursor: "pointer",
  },
};

export default Booking;
